const Page = ({ numRows }) => {
  const numPages = Math.ceil(numRows.length / 10)
  const pageArr = new Array(numPages).fill(0)

  const pageLinks = pageArr.map((num, idx) => {
    return <div key={idx}><Link number={idx+1} /></div>
  })
  return (
    <p>{numPages > 1 ? pageLinks : null}</p>
  )
}

const Link = ({ number }) => {
  return (
    <a onClick={(e) => e.preventDefault}>{number} </a>
  )
}

export default Page
